import './APILogIn.css';

function APILogIn() {

    const API_KEY = null;
    const handleSubmit = (event) => {
        API_KEY = event.target.value;
        console.log(API_KEY);
    };

    return(
        <div className="api-log-in">
            <form onSubmit={handleSubmit}>
            <label htmlFor="API_KEY">username</label>
            <input
                type="text"
                name="API Key"
                defaultValue="Insert FTX API Key Here"
                ref={(input) => (input = input)}
            />
            </form>
        </div>
    );
}

export default APILogIn;
